  Containing the Features Interpreted to be on the Sea Floor within the National Oceanic
  and Atmospheric Administration (NOAA) H11255 Survey Area in Southeastern Long Island
  Sound (H11255INTERP.SHP, Geographic)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  16,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-06T06:13:22.385721\",\n\t\"name\": \"h11255interp-shp-data-layer-containing-the-features-interpreted-to-be-on-the-sea-floor-within-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Digital terrain models (DTMs) produced
  from multibeam bathymetric data provide valuable base maps for marine geological
  interpretations. These maps help define the geological variability of the seafloor
  (one of the primary controls of benthic habitat diversity); improve our understanding
  of the processes that control the distribution and transport of bottom sediments,
  and the distribution of benthic habitats and associated infaunal community structures;
  and provide a detailed framework for future research, monitoring, and management
  activities. The bathymetric survey interpreted herein (National Oceanic and Atmospheric
  Administration (NOAA) survey H11255) covers roughly 95 km2 of seafloor in southeastern
  Long Island Sound. This bathymetry has been examined in relation to seismic reflection
  data collected concurrently, as well as archived seismic profiles acquired as part
  of a long-standing geologic mapping partnership between the State of Connecticut
  and the U.S. Geological Survey (USGS). The objective of this work was to use these
  acoustic data sets to interpret geomorphological attributes of the seafloor, and
  to use these interpretations to better understand the Quaternary geologic history
  and modern sedimentary processes.\",\n\t\"license_title\": null,\n\t\"extras\":
